import React from "react";
import { View, Image, TouchableOpacity } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { useTailwind } from "tailwind-rn";


export default function FindButton() {
  const navigation = useNavigation();
  const tailwind = useTailwind();

  return (
    <View style={tailwind("flex-row bg-gray h-[80px] justify-center itens-center")}>
      <TouchableOpacity onPress={() => navigation.navigate("Messagerie")}>
        <Image source={require("../../../../assets/icons8-magnifying-glass-48 1.svg")} style={tailwind("w-[46px] h-[36px]")} />
      </TouchableOpacity>
    </View>
  );
}
